INSERT INTO `m_directionsforusesection` VALUES (34,'Five Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,26),(35,'DIRECTIONS FOR USE',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL),(36,'General','DIRECTIONS FOR USE',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL),(52,'Five Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,34,34),(53,'MEAT/POULTRY',NULL,NULL,NULL,NULL,NULL,'The following statement is to be used if any food premise locations are listed on the final label.',NULL,NULL,NULL,2,NULL,17,NULL),(54,'MEDICAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,17,NULL),(56,'NON-MEDICAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,17,NULL),(57,'DILUTION','{DILUTION TABLE}','FOR USE AS A {{DISINFECTANT_ADJECTIVE}} DISINFECTANT {{DISINFECTANT_TYPE}}: ',NULL,NULL,NULL,'This DILUTION TABLE is optional. ',NULL,NULL,NULL,1,NULL,17,NULL),(58,'HOSPITAL','HOSPITAL/HEALTH CARE/MEDICAL/NON-MEDICAL DISINFECTION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,17,NULL),(59,'BLOODBORNE PATHOGEN INSTRUCTIONS','BLOODBORNE PATHOGEN INSTRUCTIONS: ',NULL,NULL,NULL,NULL,'Note to Reviewer: Heading is optional. If instructions used, all indented text must be included.',NULL,NULL,NULL,6,NULL,17,NULL),(60,'SURGICAL INSTRUMENT PRESOAK','SURGICAL INSTRUMENT PRESOAK: ',' {{AddMix}} 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{450PPM}}. Place pre-cleaned instruments in solution to presoak surgical instruments for a minimum of 10 minutes, then proceed with normal sterilization proc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,17,NULL),(61,'Note','Note:','Plastic instruments can remain immersed until sterilization. Metal instruments must be removed after 10 minutes, rinsed, dried, and kept in a clean non-contaminated receptacle until sterilization. Prolonged soaking will cause damage to metal instr',NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,17,NULL),(62,'ULTRASONIC BATH DISINFECTANT','ULTRASONIC BATH DISINFECTANT DIRECTIONS: ','Pre-clean heavily soiled objects. Use this product to disinfect hard, non-porous non-critical objects compatible with Ultrasonic cleaning units. Pour a fresh solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} directly into bath chamber. Place objects into unit and operate {{ManufacturersDirections}} for a minimum of 10 minutes. Remove objects and rinse with sterile water. Allow to air dry. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,17,NULL),(63,'NON-POROUS BATH AND THERAPY EQUIPMENT','FOR DISINFECTING HARD, NON-POROUS {SEALED FIBERGLASS} BATH AND THERAPY EQUIPMENT:','Drain the water from the unit. Pre-clean heavily soiled surfaces to {{RemoveBuildups}}. Prepare a use solution by adding {{3oz}} of this product per every 5 gal. of water {{EquivalentUse}} {{450PPM}}.  Refill the unit with the use solution to just cover the intake valve. Briefly start the pump to circulate the solution. Turn off pump. Wash down the unit sides, seat of the chair lift, and all related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes for proper disinfection. After the unit has been thoroughly disinfected, drain solution from the unit and rinse all surfaces with fresh water. The unit is ready for reuse.    ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,17,NULL),(64,'CLEANING AND DISINFECTING PERSONAL PROTECTIVE EQUIPMENT','CLEANING AND DISINFECTING HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{Respirators}}:','Pre-clean equipment, if heavily soiled, to ensure proper surface contact. Prepare a use solution by adding 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. Gently mix for uniform use solution. Apply use solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}} Rub with brush, cloth, or sponge. Treated surfaces must remain wet for 10 minutes. Remove excess solution from equipment prior to storage. The user must comply with all OSHA regulations for cleaning respiratory protection equipment (29 CFR § 1910.134).  Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,17,NULL),(65,'GENERAL DISINFECTION','GENERAL DISINFECTION','FOR USE AS A CLEANER/GENERAL DISINFECTANT {{KILL}} ON HARD, NON-POROUS SURFACES: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,17,NULL);
