INSERT INTO `m_directionsforusestatement` VALUES (181,'','It is a violation of Federal Law to use this product in a manner inconsistent with its labeling.',NULL,NULL,NULL,NULL,1,NULL,34,166),(182,'DIRECTIONS FOR DISINFECTlNG: (Bactericidal, Fungicidal, Virucidal)','For use on hard, non-porous surfaces in animal care facilities such as floors, walls, metal surfaces, stainless steel surfaces, glazed porcelain, and plastic surfaces. Remove gross filth and heavy soil deposits then thoroughly wet surfaces. Use 2 ounces per gallon of water (8 ounces per gallon against canine parvovirus and Porcine parvovirus) for a minimum contact time of 10 minutes in a single application. Can be applied with a cloth, mop, or sponge, as well as by coarse spray or soaking. The use solution is prepared fresh for each use then discarded. Rinsing is not necessary unless floors are to be waxed or polished. This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,2,NULL,34,174),(183,'FUNGICIDAL DIRECTIONS:','For use in areas such as locker rooms, dressing rooms, shower and bath areas and exercise facilities follow disinfection directions.',NULL,NULL,NULL,NULL,3,NULL,34,175),(184,'MILDEWSTATIC INSTRUCTIONS:','Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,NULL,NULL,NULL,4,NULL,34,176),(185,'VETERINARY CLINICS / ANIMAL CARE / ANIMAL LIFE SCIENCE LABORATORIES / ZOOS / PET SHOP / KENNELS / BREEDING AND GROOMING ESTABLISHMENTS / EQUINE FARMS DISINFECTION DIRECTIONS:','For disinfecting the following hard nonporous surfaces: equipment not used for animal food or water, utensils, instruments, cages, kennels, stables, catteries, etc. Remove all animals and feeds from premises, animal transportation vehicles, crates, etc. Remove all litter, droppings and manure from floors, walls and surfaces of facilities occupied or traversed by animals. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with a solution of 2 oz of KennelSol per gallon of water (or equivalent dilution) (8 ounces per gallon against Canine parvovirus or Porcine parvovirus), using a cloth, mop, sponge, spray, or soaking for a period of 10 minutes. Ventilate buildings and other closed spaces. Do not house animals or employ equipment until treatment has been absorbed, set or dried.',NULL,NULL,NULL,NULL,5,NULL,34,177),(186,'*FOR CANINE PARVOVIRUS (AND PORCINE PARVOVIRUS) ACTIVITY:','KennelSol is effective against Canine Parvovirus (and Porcine parvovirus) at 8 oz. per gallon. Follow Veterinary Practice / Animal Care / Animal Laboratory / Zoos / Pet Shop / Kennels Disinfection Directions.',NULL,NULL,NULL,NULL,6,NULL,34,178),(188,'**SPECIAL INSTRUCTIONS FOR INACTIVATING AVIAN INFLUENZA:','Remove all poultry and feeds from premises, trucks, coops, and crates. Remove all litter and droppings from floors, walls, and surfaces of facilities occupied or traversed by poultry. Empty all troughs, racks, and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with the disinfecting solution (2 oz per gallon of water) (660 ppm active quat) (equivalent use dilution) for a period of 10 minutes. Immerse all halters, ropes and other types of equipment sed in handling and restraining animals as well as forks, shovels, and scrapers used in removing litter and manure. Ventilate buildings, coops, and other closed spaces. Do not house poultry or employ equipment until treatment has been absorbed, set, or dried. Thoroughly scrub treated feed racks, troughs, automatic feeders, fountains, and waterers with soap or detergent, and rinse with potable water before reuse.',NULL,NULL,NULL,NULL,8,NULL,34,180),(189,'It is a violation of Federal law to use this product in a manner inconsistent with its labeling.\r\n','This product is not to be used as a terminal sterilant / high level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body.  This product may be used to preclean or decontaminate critical or semi-critical devices prior to sterilization or high-level disinfection.',NULL,NULL,NULL,NULL,1,NULL,35,NULL),(190,'IF not used on metal and or stainless steel surfaces in medical premises.','This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,2,NULL,35,NULL),(191,NULL,'It is a violation of Federal law to use this product in a manner inconsistent with its labeling.',NULL,NULL,NULL,NULL,1,NULL,36,NULL),(192,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or othen/vise enter normally sterile areas of the body. {{PreClean Text}}',NULL,NULL,NULL,NULL,2,NULL,36,NULL),(298,NULL,'It is a violation of Federal Law to use this product in a manner inconsistent with its labeling.',NULL,NULL,NULL,NULL,1,NULL,52,181),(299,'DIRECTIONS FOR DISINFECTlNG: (Bactericidal, Fungicidal, Virucidal)','For use on hard, non-porous surfaces in animal care facilities such as floors, walls, metal surfaces, stainless steel surfaces, glazed porcelain, and plastic surfaces. Remove gross filth and heavy soil deposits then thoroughly wet surfaces. Use 2 ounces per gallon of water (8 ounces per gallon against canine parvovirus and Porcine parvovirus) for a minimum contact time of 10 minutes in a single application. Can be applied with a cloth, mop, or sponge, as well as by coarse spray or soaking. The use solution is prepared fresh for each use then discarded. Rinsing is not necessary unless floors are to be waxed or polished. This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,2,NULL,52,182),(300,'FUNGICIDAL DIRECTIONS:','For use in areas such as locker rooms, dressing rooms, shower and bath areas and exercise facilities follow disinfection directions.',NULL,NULL,NULL,NULL,3,NULL,52,183),(301,'MILDEWSTATIC INSTRUCTIONS:','Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,NULL,NULL,NULL,4,NULL,52,184),(302,'VETERINARY CLINICS / ANIMAL CARE / ANIMAL LIFE SCIENCE LABORATORIES / ZOOS / PET SHOP / KENNELS / BREEDING AND GROOMING ESTABLISHMENTS / EQUINE FARMS DISINFECTION DIRECTIONS:','For disinfecting the following hard nonporous surfaces: equipment not used for animal food or water, utensils, instruments, cages, kennels, stables, catteries, etc. Remove all animals and feeds from premises, animal transportation vehicles, crates, etc. Remove all litter, droppings and manure from floors, walls and surfaces of facilities occupied or traversed by animals. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with a solution of 2 oz of KennelSol per gallon of water (or equivalent dilution) (8 ounces per gallon against Canine parvovirus or Porcine parvovirus), using a cloth, mop, sponge, spray, or soaking for a period of 10 minutes. Ventilate buildings and other closed spaces. Do not house animals or employ equipment until treatment has been absorbed, set or dried.',NULL,NULL,NULL,NULL,5,NULL,52,185),(303,'*FOR CANINE PARVOVIRUS (AND PORCINE PARVOVIRUS) ACTIVITY:','KennelSol is effective against Canine Parvovirus (and Porcine parvovirus) at 8 oz. per gallon. Follow Veterinary Practice / Animal Care / Animal Laboratory / Zoos / Pet Shop / Kennels Disinfection Directions.',NULL,NULL,NULL,NULL,6,NULL,52,186),(304,'**SPECIAL INSTRUCTIONS FOR INACTIVATING AVIAN INFLUENZA:','Remove all poultry and feeds from premises, trucks, coops, and crates. Remove all litter and droppings from floors, walls, and surfaces of facilities occupied or traversed by poultry. Empty all troughs, racks, and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with the disinfecting solution (2 oz per gallon of water) (660 ppm active quat) (equivalent use dilution) for a period of 10 minutes. Immerse all halters, ropes and other types of equipment sed in handling and restraining animals as well as forks, shovels, and scrapers used in removing litter and manure. Ventilate buildings, coops, and other closed spaces. Do not house poultry or employ equipment until treatment has been absorbed, set, or dried. Thoroughly scrub treated feed racks, troughs, automatic feeders, fountains, and waterers with soap or detergent, and rinse with potable water before reuse.',NULL,NULL,NULL,NULL,7,NULL,52,188),(305,NULL,'{Before using this product {in federally inspected meat and poultry food processing plants and dairies}, food products and packaging materials must be removed from the room or carefully protected.}',NULL,NULL,NULL,NULL,1,NULL,53,NULL),(307,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.}',NULL,NULL,NULL,NULL,NULL,NULL,54,NULL),(313,NULL,'This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,NULL,NULL,56,NULL),(314,'','1. Pre-clean heavily soiled areas. ',NULL,NULL,NULL,NULL,1,NULL,57,NULL),(315,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, mop {{Immersion}}, {{AutoScrubber}} {{CleaningEquipment}}',NULL,NULL,NULL,NULL,2,NULL,57,NULL),(316,NULL,'3. Treated surfaces must remain wet for 10 minutes.',NULL,NULL,NULL,NULL,3,NULL,57,NULL),(317,NULL,'4. {{Dry}} {{Rinsing}}',NULL,NULL,NULL,NULL,4,NULL,57,NULL),(318,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,5,NULL,57,NULL),(319,'*KILLS HIV, HBV and HCV ON PRE-CLEANED HARD, NON-POROUS SURFACES/OBJECTS PREVIOUSLY SOILED WITH BLOOD/BODY FLUIDS ','in health care settings or other settings in which there is an expected likelihood of soiling of hard, non-porous surfaces/objects with blood or body fluids and in which the surfaces/objects likely to be soiled with blood or body fluids can be associated with the potential for transmission of Human Immunodeficiency Virus Type 1 {{HIV-1}} {{AIDS}}, Hepatitis B Virus {{HBV}} and Hepatitis C Virus {{HCV}}.',NULL,NULL,NULL,NULL,NULL,NULL,59,NULL),(320,'SPECIAL INSTRUCTIONS FOR CLEANING AND DECONTAMINATION AGAINST HIV-1, HBV and HCV ON SURFACES/OBJECTS SOILED WITH BLOOD/BODY FLUIDS. ',NULL,NULL,NULL,NULL,NULL,2,NULL,59,NULL),(321,'Personal Protection:  ','{{ProtectiveWearOrBarrier}}.',NULL,NULL,NULL,NULL,3,NULL,59,NULL),(322,'Cleaning Procedure:  ','Blood and other body fluids {{HIV-1}} must be thoroughly cleaned from hard, non-porous surfaces and objects before application of {{ThisDisinfectant}}. ',NULL,NULL,NULL,NULL,4,NULL,59,NULL),(323,'Disposal of Infectious Materials:  ','Blood and other body fluids, cleaning materials and clothing must be autoclaved and disposed of according to federal, state and local regulations for infectious waste disposal. ',NULL,NULL,NULL,NULL,5,NULL,59,NULL),(324,'Contact Time:  ','Allow hard, non-porous surfaces to remain wet for 2 minutes to kill HIV and for 10 minutes to kill all other viruses and bacteria listed on the label.',NULL,NULL,NULL,NULL,6,NULL,59,NULL),(325,NULL,'1. Pre-clean surfaces.',NULL,NULL,NULL,NULL,1,NULL,65,NULL),(326,NULL,'2. Apply use solution of 1.75 oz. of this product per 5 gal. of water {{260PPM}} {{EquivalentDilution}} to hard, nonporous surfaces with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.',NULL,NULL,NULL,NULL,2,NULL,65,NULL),(327,NULL,'3. Treated Surfaces must remain wet for 10 minutes.',NULL,NULL,NULL,NULL,3,NULL,65,NULL),(328,NULL,'4. {{WipeOrAirDry}}',NULL,NULL,NULL,NULL,4,NULL,65,NULL),(329,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,5,NULL,65,NULL),(330,NULL,'1. Pre-clean heavily soiled areas.',NULL,NULL,NULL,NULL,1,NULL,58,NULL),(331,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, mop {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}}.',NULL,NULL,NULL,NULL,2,NULL,58,NULL),(332,NULL,'3. Treated surfaces must remain wet for 10 minutes.',NULL,NULL,NULL,NULL,3,NULL,58,NULL),(333,NULL,'4. {{WipeOrAirDry}}. {{Rinsing}}',NULL,NULL,NULL,NULL,4,NULL,58,NULL),(334,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,5,NULL,58,NULL);
