INSERT INTO `m_generalstatement` VALUES (53,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,26,47,NULL),(54,'If in eyes:','Hold eye open and rinse slowly and gently with water for 15  20 minutes. Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,1,27,48,NULL),(55,'If on skin or clothing:','Take off contaminated clothing. Rinse skin immediately with plenty of water for 15  20 minutes.',NULL,2,27,49,NULL),(56,'If swallowed:','Call a poison control center or doctor immediately for treatment advice. Have person sip a glass of water if able to swallow. Do not induce vomiting unless told to do so by the poison control center or doctor. Do not give anything by mouth to an unconscious person.',NULL,3,27,50,NULL),(57,'If inhaled:','Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible. Call a poison control center or doctor for treatment advice. Have the product container or label with you when calling a poison control center or doctor or going for treatment. NOTE TO PHYSICIAN: Probable mucosal damage may contraindicate the use of gastric lavage. Measures against circulatory shock, respiratory depression and convulsion may be needed.ove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,4,27,51,NULL),(58,NULL,'Do not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans, or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product to sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA.',NULL,NULL,28,52,NULL),(59,NULL,'PHYSICAL OR CHEMICAL HAZARDS\r\nDo not mix with oxidizers, anionic soaps and detergents.\r\nDo not use or store near heat or open flame.',NULL,1,31,NULL,NULL),(60,NULL,'Corrosive. Causes irreversible eye damage and skin burns. Harmful if swallowed, inhaled or absorbed through the skin. Avoid breathing spray mist. Do not get in eyes, on skin, or on clothing. Wear goggles or face shield, rubber gloves and protective clothing when handling. Wash thoroughly with soap and water after handling and before eating, drinking, or using tobacco. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,30,NULL,NULL),(61,NULL,'ENVIRONMENTAL HAZARDS\r\nDo not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product into sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA. ',NULL,2,31,NULL,NULL),(62,NULL,'IF ON SKIN OR CLOTHING: Take off contaminated clothing. Rinse skin immediately with plenty of water for 15  20 minutes. Call a poison control center or doctor for treatment advice.',NULL,1,29,NULL,NULL),(63,NULL,'IF IN EYES: Hold eye open and rinse slowly and gently with water for 15  20 minutes.  Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye. Call a poison control center or doctor for treatment advice.',NULL,2,29,NULL,NULL),(64,NULL,'IF SWALLOWED: Call a poison control center or doctor immediately for treatment advice. Have person sip a glass of water if able to swallow.  Do not induce vomiting unless told to do so by the poison control center or doctor. Do not give anything by mouth to an unconscious person.',NULL,3,29,NULL,NULL),(65,NULL,'IF INHALED: Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible. Call a poison control center or doctor for treatment advice.',NULL,4,29,NULL,NULL),(66,NULL,'NOTE TO PHYSICIAN: Probable mucosal damage may contraindicate the use of gastric lavage.',NULL,5,29,NULL,NULL),(67,NULL,'Have the product container or label with you when calling a poison control center or doctor or going for treatment.',NULL,6,29,NULL,NULL),(84,NULL,'In case of emergency, call a poison control center or doctor for treatment advice. Have the product container or label with you when calling a poison control center or doctor, or going for treatment.',NULL,1,41,NULL,NULL),(85,'IF IN EYES:','Hold eye open and rinse slowly and gently with water for 15-20 minutes. Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,2,41,NULL,NULL),(86,'IF ON SKIN:','Take off contaminated clothing. Rinse skin immediately with plenty of water for 15-20 minutes.',NULL,3,41,NULL,NULL),(87,'IF SWALLOWED:','Have person sip a glass of water if able to swallow. Do not Induce vomiting unless told to do so by a poison control center or doctor. Do not give anything by mouth to an unconscious person. Call a poison control center or.doctor Immediately for treatment advice.',NULL,4,41,NULL,NULL),(88,'IF INHALED:','Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably mouth-to-mouth, if possible.',NULL,5,41,NULL,NULL),(89,'NOTE TO PHYSICIAN:','Probable mucosal damage may contraindicat