INSERT INTO `m_storagedisposalstatement` VALUES (42,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,'NA','',NULL,1,NULL,18,37),(43,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,2,NULL,18,38),(44,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,3,NULL,18,39),(45,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,4,NULL,18,40),(46,NULL,'Container Handling','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,'NA',NULL,NULL,5,NULL,18,NULL),(48,NULL,NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,20,NULL),(49,NULL,'PESTICIDE STORAGE:','Open dumping is prohibited.  Store only in original container. Do not reuse empty container. Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,2,NULL,20,NULL),(50,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous.  Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law.  If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,3,NULL,20,NULL),(51,NULL,'Container Disposal','(Plastic containers:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn.  If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles.  Empty residue into application equipment.  Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities.  If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities.  If burned, stay out of smoke.',NULL,'NA',NULL,NULL,4,NULL,20,NULL),(52,NULL,'STORAGE AND DISPOSAL','Store in original container in areas inaccessible to children. Do not reuse empty container.  Wrap and discard in trash (or recycle).',NULL,'NA',NULL,NULL,NULL,NULL,21,NULL),(53,NULL,'DISPOSAL:','Do not reuse container.  Wrap and put in trash collection.',NULL,'NA',NULL,NULL,NULL,NULL,22,NULL),(55,NULL,NULL,'Do not contaminate water, food, or feed by storage and disposal.',NULL,'NA',NULL,NULL,1,NULL,24,NULL),(56,NULL,'{{PESTICIDE}}STORAGE:','Store oniy in original container Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,2,NULL,24,NULL),(57,NULL,'PESTICIDE DISPOSAL','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste Representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,3,NULL,24,NULL),(58,NULL,NULL,'(For residential/household use ONLY)',NULL,'NA',NULL,NULL,NULL,NULL,25,NULL),(59,NULL,NULL,'Non-refillable container. Do not reuse or refill this container. Offer for recycling if available or place in trash.',NULL,'NA',NULL,NULL,NULL,NULL,26,NULL),(60,NULL,'Non-Refillable Container','Do not reuse or refill this container. Triple rinse container {(or equivalent)} promptly after emptying. Triple rinse as follows: Fill the container % full with water and recap. Shake for 10 seconds; Drain for 10 seconds after the flow begins to drip. Follow Pesticide Disposal instructions for rinsate disposal. Repeat this procedure two more times. Then offer for recycling if available or puncture and dispose of in a sanitary landfill, or by incineration.',NULL,'NA',NULL,NULL,NULL,NULL,27,NULL),(61,NULL,'Non-Refillable Container','Do not reuse or refill this container. Triple rinse container {{Equivalent}}promptly after emptying. Triple rinse as follows; Fill the container % full with water. Replace and tighten closures. Tip container on its side and roll it back and forth, ensuring at least one complete revolution, for 30 seconds. Stand the container on its end and tip back and forth several times. Turn the container over onto its other end and tip back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat this procedure two more times. Then offer for recycling if available or puncture and dispose of in a sanitary landfill, or by incineration.',NULL,'NA',NULL,NULL,NULL,NULL,28,NULL),(62,NULL,'Non-Refillable Container','Do not reuse or refill this container. Wrap empty container and put in trash or offer for recycling.',NULL,'NA',NULL,NULL,NULL,NULL,29,NULL),(63,NULL,'Refillable Containter','Refill this container with this product only. Do not reuse this container for any other purpose. Cleaning the container before final disposal is the responsibility of the person disposing of the container. Cleaning before refilling is the responsibility of the refiller. To dean the container before final disposal empty the remaining contents from this container into application equipment, or a mix tank. Fill container about 10 percent full with water. Agitate vigorously or recirculate water with the pump for 2 minutes. Pour or pump rinsate into application equipment or rinsate collection system. Repeat this rinsing procedure two more times.',NULL,'NA',NULL,NULL,NULL,NULL,30,NULL),(64,NULL,'{PESTICIDE} STORAGE','Store only in original container. Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,1,NULL,32,NULL),(65,NULL,'PESTICIDE DISPOSAL:','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste Representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,2,NULL,32,NULL),(66,NULL,'CONTAINER HANDLING:','Non-Refillable Container. Do not reuse or refill this container. Wrap empty container and put in trash or offer for recycling.',NULL,'NA',NULL,NULL,3,NULL,32,NULL),(145,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,'NA',NULL,NULL,1,NULL,49,42),(146,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,2,NULL,49,43),(147,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,3,NULL,49,44),(148,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,4,NULL,49,45),(149,NULL,'Container Handling','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,'NA',NULL,NULL,5,NULL,49,46),(151,NULL,'SD Substatement tt','SD Substatement x',NULL,'NA','SD Substatement r',NULL,NULL,66,NULL,NULL),(152,NULL,'Sub2 t','Sub2 x',NULL,'NA','Sub2 r',NUL