INSERT INTO `s_generalstatement` VALUES (19,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,41,10,41),(20,NULL,'If on skin or clothing\n   - Take off contaminated clothing.\n   - Rinse skin immediately with plenty of water for 15-20 minutes.',NULL,1,42,11,42),(21,NULL,'If swallowed\n   - Call a poison control center or doctor immediately for treatment advice.\n   - Have person sip a glass of water if able to swallow.\n   - Do not induce vomiting unless told to do so by the poison control center or doctor.\n   - Do not give anything by mouth to an unconscious person.',NULL,2,43,11,43),(22,NULL,'If inhaled\n   - Move person to fresh air.\n   - If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible.',NULL,3,44,11,44),(23,NULL,'If in eyes\r\n   - Hold eye open and rinse slowly and gently with water for 15-20 minutes.\r\n   - Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,4,45,11,45),(24,NULL,'Do not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans, or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product to sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA.',NULL,NULL,46,12,46),(85,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,53,43,53),(86,'If in eyes:','Hold eye open and rinse slowly and gently with water for 15  20 minutes. Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,1,54,44,54),(87,'If on skin or clothing:','Take off contaminated clothing. Rinse skin immediately with plenty of water for 15  20 minutes.',NULL,2,55,44,55),(88,'If swallowed:','Call a poison control center or doctor immediately for treatment advice. Have person sip a glass of water if able to swallow. Do not induce vomiting unless told to do so by the poison control center or doctor. Do not give anything by mouth to an unconscious person.',NULL,3,56,44,56),(89,'If inhaled:','Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible. Call a poison control center or doctor for treatment advice. Have the product container or label with you when calling a poison control center or doctor or going for treatment. NOTE TO PHYSICIAN: Probable mucosal damage may contraindicate the use of gastric lavage. Measures against circulatory shock, respiratory depression and convulsion may be needed.ove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,4,57,44,57),(90,NULL,'Do not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans, or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product to sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA.',NULL,NULL,58,45,58),(91,NULL,'IF ON SKIN OR CLOTHING: Take off contaminated clothing. Rinse skin immediately with plenty of water for 15  20 minutes. Call a poison control center or doctor for treatment advice.',NULL,1,62,46,NULL),(92,NULL,'IF IN EYES: Hold eye open and rinse slowly and gently with water for 15  20 minutes.  Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye. Call a poison control center or doctor for treatment advice.',NULL,2,63,46,NULL),(93,NULL,'If swallowed: Call a poison control center or doctor immediately for treatment advice. Have person sip a glass of water if able to swallow.  Do not induce vomiting unless told to do so by the poison control center or doctor. Do not give anything by mouth to an unconscious person.',NULL,3,64,46,NULL),(94,NULL,'IF INHALED: Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible. Call a poison control center or doctor for treatment advice.',NULL,4,65,46,NULL),(95,NULL,'NOTE TO PHYSICIAN: Probable mucosal damage may contraindicate the use of gastric lavage.',NULL,5,66,46,NULL),(96,NULL,'Have the product container or label with you when calling a poison control center or doctor or going for treatment.',NULL,6,67,46,NULL),(97,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,60,47,NULL),(98,NULL,'PHYSICAL OR CHEMICAL HAZARDS\r\nDo not mix with oxidizers, anionic soaps and detergents.\r\nDo not use or store near heat or open flame.',NULL,1,59,48,NULL),(99,NULL,'ENVIRONMENTAL HAZARDS\r\nDo not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans, or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge.  Do not discharge effluent containing this product to sewer systems without previously notifying the local sewage treatment plant authority.  For guidance contact your State Water Board or Regional Office of the EPA.\r\n',NULL,2,61,48,NULL),(310,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,NULL,163,NULL),(311,'If in eyes:','Hold eye open and rinse slowly and gently with water for 15  20 minutes. Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,1,NULL,164,NULL),(312,'If on skin or clothing:','Take off contaminated clothing. Rinse skin immediately with plenty of water for 15  20 minutes.',NULL,2,NULL,164,NULL),(313,'If swallowed:','Call a poison control center or doctor immediately for treatment advice. Have person sip a glass of water if able to swallow. Do not induce vomiting unless told to do so by the poison control center or doctor. Do not give anything by mouth to an unconscious person.',NULL,3,NULL,164,NULL),(314,'If inhaled:','Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible. Call