INSERT INTO `s_marketingstatement` VALUES (94,NULL,'Recommended for use in kennels, pet shops, veterinary clinics, animal life science laboratories, breeding establishments, grooming establishments, schools, colleges, federally inspected meat and poultry plants, equine farms, tack shops, zoos, poultry farms, turkey farms, dairy farms, hog farms, and households. Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, nonmedical metal surfaces, non-medical stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.). Recommeded for use in: Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,71,NULL,NULL,35,71),(95,NULL,'For use on Highchairs, Sealed terra cotta, Tanning Equipment, Plastic (such as polystyrene or polypropylene), Upholstery, Floors, Refrigerators, Conductive flooring, Refrigerated storage and display equipment, Glazed enameled surfaces, Garbage cans, Bathtubs (Fiberglass), Counters (countertops), Doorknobs, Stainless steel, Coils and drain pans of air conditioning and refri, Microwave ovens, Laminated surfaces, Tanning Beds, Other hard nonporous surfaces made of:, Sealed granite, Telephones, Desks, Outdoor furniture, Woodwork, Cabinets, Chairs, Sealed terrazzo, Bathroom fixtures, Countertop laminates, Metal, Appliances, Sealed limestone, Kennel runs, Sealed slate, Glazed ceramic and Cages.',NULL,72,NULL,NULL,36,72),(96,NULL,NULL,NULL,75,NULL,NULL,37,75),(135,NULL,'Germicidal Detergent and Deordorant',NULL,103,NULL,NULL,80,103),(136,NULL,'For use in: {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous\r\ninanimate surfaces: {{Surface}}, etc.).',NULL,101,NULL,NULL,81,101),(137,NULL,'For use in {{Area Of Use}}.',NULL,104,NULL,NULL,82,104),(138,NULL,'A multi-purpose germicidal detergent and deodorant effective in hard waters up to 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum. Disinfects, cleans, and deodorizes in one labor saving step.',NULL,106,NULL,NULL,83,106),(139,NULL,'Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,102,NULL,NULL,84,102),(140,NULL,'Bactericidal against the following pathogenic bacteria according to the AOAC Use-Dilution Test method, current edition, modified in the presence of 400 ppm synthetic hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum:',NULL,105,NULL,NULL,85,105),(141,NULL,'Fungicidal against {{Claims}} albicans according to the AOAC fungicidal test, modified in the presense of 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum.',NULL,107,NULL,NULL,86,107),(142,NULL,'Virucidal against {{Claims}} according to the virucidal qualification, modified in the presence of 400 ppm hard water (calculated as CaCO3) plus 5 % organic serum.',NULL,108,NULL,NULL,87,108),(143,'optional marketing language','Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)\r\n\r\nA multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO3) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test.  Disinfects, cleans, and deodorizes in one labor-saving step.\r\n\r\nRecommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households.  Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.\r\n\r\nDisinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical) stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).\r\n\r\nUse [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.\r\nUse [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shields, hearing protectors, and ear muffs.  Rinse all equipment that comes in prolonged contact with skin with warm water and allow to air dry before reuse.  [Caution: Cleaning at the recommended 120ºF. temperature will avoid overheating and distortion of the personal safety equipment that would necessitate replacement.]',NULL,NULL,NULL,NULL,88,109),(359,NULL,'Germicidal Detergent and Deordorant',NULL,103,NULL,NULL,288,103),(360,NULL,'For use in: {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous\r\ninanimate surfaces: {{Surface}}, etc.).',NULL,101,NULL,NULL,289,101),(361,NULL,'For use in {{Area Of Use}}.',NULL,104,NULL,NULL,290,104),(362,NULL,'A multi-purpose germicidal detergent and deodorant effective in hard waters up to 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum. Disinfects, cleans, and deodorizes in one labor saving step.',NULL,106,NULL,NULL,291,106),(363,NULL,'Germicidal Detergent and Deordorant',NULL,279,NULL,135,292,279),(364,NULL,'For use in: {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous\r\ninanimate surfaces: {{Surface}}, etc.).',NULL,280,NULL,136,293,280),(365,NULL,'For use in {{Area Of Use}}.',NULL,281,NULL,137,294,281),(366,NULL,'A multi-purpose germicidal detergent xxxxxxxxxxxxxxup to 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum. Disinfects, cleans, and deodorizes in one labor saving step.',NULL,282,NULL,138,295,282),(367,NULL,'Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,283,NULL,139,296,283),(368,NULL,'Bactericidal against the following pathogenic bacteria according to the AOAC Use-Dilution Test method, current edition, modified in the presence of 400 ppm synthetic hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum:',NULL,284,NULL,140,297,284),(369,NULL,'Fungicidal against {{Claims}} albicans according to the AOAC fungicidal test, modified in the presense of 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum.',NULL,285,NULL,141,298,285),(370,NULL,'Virucidal against {{Claims}} according to the virucidal qualification, modified in the presence of 400 ppm hard water (calculated as CaCO3) plus 5 % organic serum.',NULL,286,NULL,142,299,286);
