INSERT INTO `s_storagedisposalstatement` VALUES (16,NULL,NULL,'Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.',NULL,'NA',NULL,NULL,31,NULL,31,7),(17,NULL,NULL,'Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,32,1,32,8),(18,NULL,'Pesticide Storage','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,33,2,33,8),(19,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,34,3,34,8),(20,NULL,'Container Disposal','(Plastic containers:) Triple rinse (or equivalent). Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn. If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles. Empty residue into application equipment. Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities. If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent). Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities. If burned, stay out of smoke.\r\n',NULL,'NA',NULL,NULL,35,4,35,8),(71,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,'NA',NULL,NULL,42,1,42,24),(72,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,43,2,43,24),(73,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,44,3,44,24),(74,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,45,4,45,24),(75,NULL,'Container Handling','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,'NA',NULL,NULL,46,5,46,24),(76,NULL,NULL,NULL,NULL,'NA',NULL,NULL,NULL,1,48,25),(77,NULL,'PESTICIDE STORAGE:','Open dumping is prohibited.  Store only in original container. Do not reuse empty container. Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,NULL,2,49,25),(78,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous.  Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law.  If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,NULL,3,50,25),(79,NULL,'Container Disposal','(Plastic containers:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn.  If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles.  Empty residue into application equipment.  Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities.  If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities.  If burned, stay out of smoke.',NULL,'NA',NULL,NULL,NULL,4,51,25),(80,NULL,'STORAGE AND DISPOSAL','Store in original container in areas inaccessible to children. Do not reuse empty container.  Wrap and discard in trash (or recycle).',NULL,'NA',NULL,NULL,NULL,NULL,52,26),(81,NULL,'DISPOSAL:','Do not reuse container.  Wrap and put in trash collection.',NULL,'NA',NULL,NULL,NULL,NULL,53,27),(242,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,'NA',NULL,NULL,NULL,1,NULL,62),(243,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,NULL,2,NULL,62),(244,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,NULL,3,NULL,62),(245,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,NULL,4,NULL,62),(246,NULL,'Container Handling','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,'NA',NULL,NULL,NULL,5,NULL,62),(247,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container.