INSERT INTO `spld_directionsforusestatement` VALUES (2703,'It is a violation of Federal law to use this product in a manner inconsistent with its labeling.\r\n','This product is not to be used as a terminal sterilant / high level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body.  This product may be used to preclean or decontaminate critical or semi-critical devices prior to sterilization or high-level disinfection.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,395,68),(2704,'IF not used on metal and or stainless steel surfaces in medical premises.','This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,395,69),(3020,NULL,'It is a violation of Federal Law to use this product in a manner inconsistent with its labeling.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,441,61),(3021,'DIRECTIONS FOR DISINFECTlNG: (Bactericidal, Fungicidal, Virucidal)','For use on hard, non-porous surfaces in animal care facilities such as floors, walls, metal surfaces, stainless steel surfaces, glazed porcelain, and plastic surfaces. Remove gross filth and heavy soil deposits then thoroughly wet surfaces. Use 2 ounces per gallon of water (8 ounces per gallon against canine parvovirus and Porcine parvovirus) for a minimum contact time of 10 minutes in a single application. Can be applied with a cloth, mop, or sponge, as well as by coarse spray or soaking. The use solution is prepared fresh for each use then discarded. Rinsing is not necessary unless floors are to be waxed or polished. This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,441,62),(3022,'FUNGICIDAL DIRECTIONS:','For use in areas such as locker rooms, dressing rooms, shower and bath areas and exercise facilities follow disinfection directions.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,441,63),(3023,'MILDEWSTATIC INSTRUCTIONS:','Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,441,64),(3024,'VETERINARY CLINICS / ANIMAL CARE / ANIMAL LIFE SCIENCE LABORATORIES / ZOOS / PET SHOP / KENNELS / BREEDING AND GROOMING ESTABLISHMENTS / EQUINE FARMS DISINFECTION DIRECTIONS:','For disinfecting the following hard nonporous surfaces: equipment not used for animal food or water, utensils, instruments, cages, kennels, stables, catteries, etc. Remove all animals and feeds from premises, animal transportation vehicles, crates, etc. Remove all litter, droppings and manure from floors, walls and surfaces of facilities occupied or traversed by animals. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with a solution of 2 oz of KennelSol per gallon of water (or equivalent dilution) (8 ounces per gallon against Canine parvovirus or Porcine parvovirus), using a cloth, mop, sponge, spray, or soaking for a period of 10 minutes. Ventilate buildings and other closed spaces. Do not house animals or employ equipment until treatment has been absorbed, set or dried.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,441,65),(3025,'*FOR CANINE PARVOVIRUS (AND PORCINE PARVOVIRUS) ACTIVITY:','KennelSol is effective against Canine Parvovirus (and Porcine parvovirus) at 8 oz. per gallon. Follow Veterinary Practice / Animal Care / Animal Laboratory / Zoos / Pet Shop / Kennels Disinfection Directions.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,6,441,66),(3026,'**SPECIAL INSTRUCTIONS FOR INACTIVATING AVIAN INFLUENZA:','Remove all poultry and feeds from premises, trucks, coops, and crates. Remove all litter and droppings from floors, walls, and surfaces of facilities occupied or traversed by poultry. Empty all troughs, racks, and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with the disinfecting solution (2 oz per gallon of water) (660 ppm active quat) (equivalent use dilution) for a period of 10 minutes. Immerse all halters, ropes and other types of equipment sed in handling and restraining animals as well as forks, shovels, and scrapers used in removing litter and manure. Ventilate buildings, coops, and other closed spaces. Do not house poultry or employ equipment until treatment has been absorbed, set, or dried. Thoroughly scrub treated feed racks, troughs, automatic feeders, fountains, and waterers with soap or detergent, and rinse with potable water before reuse.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,7,441,67),(3041,'Recommended','This product is not to be used as a terminal sterilant / high level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. This product may be used to preclean or decontaminate critical or semi-critical devices prior to sterilization or high-level disinfection.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,444,53),(3042,'DISINFECTION / Cleaning / Deodorizing Directions:','Remove heavy soil deposits from surface. Then thoroughly wet surface with a use-solution of 1/2 oz. of the concentrate per gallon of water. (Use 2 oz per gallon of water to kill Adenovirus Type 7). The use-solution can be applied with a cloth, mop, sponge, or coarse spray, or soaking. For sprayer applications, use a coarse spray device. Spray 6-8 inches from the surface, rub with a brush, cloth or sponge. Do not breathe spray. Let solution remain on surface for a minimum of 10 minutes. Rinse or allow to air dry. Rinsing of floors is not necessary unless they are to be waxed or polished.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,444,54),(3043,'TOILET BOWLS [ / URINALS]','Swab bowl with brush to remove heavy soil prior to cleaning or disinfecting. Clean by applying use-solution around the bowl and up under the rim. Stubborn stains may require brushing. To disinfect, first preclean to remove heavy soil, then remove or expel over the inner trap the residual bowl water. Pour in 3 oz. of the usesolution. Swab the bowl completely using a scrub brush or mop, making sure to get under rim. Let stand for 10 minutes or overnight, then flush.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,444,55),(3044,'MILDEWSTATIC INSTRUCTIONS:','Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,444,56),(3045,'SPECIAL INSTRUCTIONS FOR CLEANING AND DECONTAMINATION AGAINST HIV-1 (AIDS VIRUS) OR HBV OR HCV ON SURFACES / OBJECTS SOILED WITH BLOOD / BODY FLUIDS:','Personal Protection: Disposable protective gloves, gowns, face masks, or eye coverings as appropriate must be worn during all cleaning of blood / body fluids and during decontamination procedures. Cleaning Procedures: Blood / body fluids must be thoroughly cleaned from surfaces / objects before application of disinfectant. Contact Time: HIV-1 (AIDS virus) is inactivated after a contact time of 4 minutes at 25#C (77degF) (room temperature). HBV and HCV are inactivated after a 10 minute contact time. Use a 10-minute contact time for all other viruses, fungi, and bacteria listed. Disposal of Infectious Materials: Blood / body fluids should be autoclaved and disposed of according to federal, state, and local regulations for infectious waste disposal.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,444,57),(3046,'SALON (BARBER) INSTRUMENTS AND TOOLS DISINFECTION (BACTERICIDE) / VIRUCIDE / FUNGICIDE DIRECTIONS:','Mix 1/2 oz. of Formulation HWS-256 per gallon of water (or equivalent dilution) to disinfect hard, nonporous instruments and tools. (Use 2 oz per gallon of water to kill Adenovirus Type 7.) Completely immerse combs, brushes, rollers, razors, scissors, blades, manicure and other salon instruments and tools for 10 minutes. For heavily soiled instruments and tools, a preliminary cleaning is required. Rinse thoroughly and dry before use. Prepare a fresh solution daily or more often if the solution becomes visibly diluted, cloudy or soiled. Note: Plastics may remain immersed until ready to use. Stainless steel shears and instruments must be removed after 10 minutes, rinsed, dried and kept in a clean, non-contaminated receptacle. Prolonged soaking may cause damage to metal instruments.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,6,444,58),(3047,'DISINFECTION OF HARD, NON-POROUS SURFACES IN FOOTBATHS:','To remove body oils, dead tissue, soil and all other buildups or organic matter on inanimate surfaces after using the footbath, drain the water and thoroughly clean all hard, non-porous surfaces with soap or detergent, then rinse with water. Saturate surfaces with a use solution of 1/2 oz. per gallon of water (or equivalent use dilution) to exposed surfaces with a cloth, mop, sponge or sprayer. (Use 2 oz per gallon of water to kill Adenovirus Type 7). For spray applications, use a coarse spray device. Do not breathe spray. Brush or swab thoroughly and allow solution to stand for 10 minutes. After the unit has been thoroughly disinfected, rinse all surfaces with fresh water. Do not use equipment until treatment has been absorbed, set or dried.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,7,444,59),(3048,'CLEANSING OF BODY SURFACES AND BODY ORIFICES OF HUMAN REMAINS:','This product removes body secretions, soil, and blood, along with their accompanying malodor, from the surfaces and orifices of human remains. Using a sponge or washcloth, bathe the entire body with a use-solution of 1/2 oz. per gallon of water. (Use 2 oz per gallon of water to kill Adenovirus Type 7.) A soft hand brush may be employed on surfaces other than the face. Prepare a fresh solution for each (cadaver) remains or when solution becomes visibly dirty or diluted\r\nCarpets: 1/2 oz. per gallon of shampoo solution eliminates odors associated with urine, vomit, smoke, and mildew. Reapply after cleaning for freshening effects. Allow to dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,8,444,60),(3077,'Recommended','This product is not to be used as a terminal sterilant / high level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. This product may be used to preclean or decontaminate critical or semi-critical devices prior to sterilization or high-level disinfection.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,449,114),(3078,'DISINFECTION / Cleaning / Deodorizing Directions:','Remove heavy soil deposits from surface. Then thoroughly wet surface with a use-solution of 1/2 oz. of the concentrate per gallon of water. (Use 2 oz per gallon of water to kill Adenovirus Type 7). The use-solution can be applied with a cloth, mop, sponge, or coarse spray, or soaking. For sprayer applications, use a coarse spray device. Spray 6-8 inches from the surface, rub with a brush, cloth or sponge. Do not breathe spray. Let solution remain on surface for a minimum of 10 minutes. Rinse or allow to air dry. Rinsing of floors is not necessary unless they are to be waxed or polished.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,449,115),(3079,'TOILET BOWLS [ / URINALS]','Swab bowl with brush to remove heavy soil prior to cleaning or disinfecting. Clean by applying use-solution around the bowl and up under the rim. Stubborn stains may require brushing. To disinfect, first preclean to remove heavy soil, then remove or expel over the inner trap the residual bowl water. Pour in 3 oz. of the usesolution. Swab the bowl completely using a scrub brush or mop, making sure to get under rim. Let stand for 10 minutes or overnight, then flush.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,449,116),(3080,'MILDEWSTATIC INSTRUCTIONS:','Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,449,117),(3081,'SPECIAL INSTRUCTIONS FOR CLEANING AND DECONTAMINATION AGAINST HIV-1 (AIDS VIRUS) OR HBV OR HCV ON SURFACES / OBJECTS SOILED WITH BLOOD / BODY FLUIDS:','Personal Protection: Disposable protective gloves, gowns, face masks, or eye coverings as appropriate must be worn during all cleaning of blood / body fluids and during decontamination procedures. Cleaning Procedures: Blood / body fluids must be thoroughly cleaned from surfaces / objects before application of disinfectant. Contact Time: HIV-1 (AIDS virus) is inactivated after a contact time of 4 minutes at 25#C (77degF) (room temperature). HBV and HCV are inactivated after a 10 minute contact time. Use a 10-minute contact time for all other viruses, fungi, and bacteria listed. Disposal of Infectious Materials: Blood / body fluids should be autoclaved and disposed of according to federal, state, and local regulations for infectious waste disposal.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,449,118),(3082,'SALON (BARBER) INSTRUMENTS AND TOOLS DISINFECTION (BACTERICIDE) / VIRUCIDE / FUNGICIDE DIRECTIONS:','Mix 1/2 oz. of Formulation HWS-256 per gallon of water (or equivalent dilution) to disinfect hard, nonporous instruments and tools. (Use 2 oz per gallon of water to kill Adenovirus Type 7.) Completely immerse combs, brushes, rollers, razors, scissors, blades, manicure and other salon instruments and tools for 10 minutes. For heavily soiled instruments and tools, a preliminary cleaning is required. Rinse thoroughly and dry before use. Prepare a fresh solution daily or more often if the solution becomes visibly diluted, cloudy or soiled. Note: Plastics may remain immersed until ready to use. Stainless steel shears and instruments must be removed after 10 minutes, rinsed, dried and kept in a clean, non-contaminated receptacle. Prolonged soaking may cause damage to metal instruments.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,6,449,119),(3083,'DISINFECTION OF HARD, NON-POROUS SURFACES IN FOOTBATHS:','To remove body oils, dead tissue, soil and all other buildups or organic matter on inanimate surfaces after using the footbath, drain the water and thoroughly clean all hard, non-porous surfaces with soap or detergent, then rinse with water. Saturate surfaces with a use solution of 1/2 oz. per gallon of water (or equivalent use dilution) to exposed surfaces with a cloth, mop, sponge or sprayer. (Use 2 oz per gallon of water to kill Adenovirus Type 7). For spray applications, use a coarse spray device. Do not breathe spray. Brush or swab thoroughly and allow solution to stand for 10 minutes. After the unit has been thoroughly disinfected, rinse all surfaces with fresh water. Do not use equipment until treatment has been absorbed, set or dried.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,7,449,120),(3084,'CLEANSING OF BODY SURFACES AND BODY ORIFICES OF HUMAN REMAINS:','This product removes body secretions, soil, and blood, along with their accompanying malodor, from the surfaces and orifices of human remains. Using a sponge or washcloth, bathe the entire body with a use-solution of 1/2 oz. per gallon of water. (Use 2 oz per gallon of water to kill Adenovirus Type 7.) A soft hand brush may be employed on surfaces other than the face. Prepare a fresh solution for each (cadaver) remains or when solution becomes visibly dirty or diluted\r\nCarpets: 1/2 oz. per gallon of shampoo solution eliminates odors associated with urine, vomit, smoke, and mildew. Reapply after cleaning for freshening effects. Allow to dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,8,449,121),(3137,NULL,'It is a violation of Federal Law to use this product in a manner inconsistent with its labeling.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,455,31),(3138,NULL,'For use on hard, non-porous surfaces in animal care facilities such as {{Surface}}. Remove gross filth and heavy soil deposits then thoroughly wet surfaces. Use 2 ounces per gallon of water (8 ounces per gallon against canine parvovirus and Porcine parvovirus) for a minimum contact time of 10 minutes in a single application. Can be applied with a cloth, mop, or sponge, as well as by coarse spray or soaking. The use solution is prepared fresh for each use then discarded. Rinsing is not necessary unless floors are to be waxed or polished. This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,456,32),(3139,NULL,'For use in areas such as {{Area Of Use}} follow disinfection directions.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,457,33),(3140,NULL,'Will effectively control the growth of mold and mildew plus the odors caused by them when applied to hard, non-porous surfaces such as walls, floors, and table tops. Apply solution (2 ounces per gallon of water) with a cloth, mop, sponge or coarse spray making sure to wet all surfaces completely. Let air dry. Repeat application weekly or when growth reappears.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,458,34),(3141,NULL,'For disinfecting the following hard nonporous surfaces: equipment not used for animal food or water, utensils, instruments, cages, kennels, stables, catteries, etc. Remove all animals and feeds from premises, animal transportation vehicles, crates, etc. Remove all litter, droppings and manure from floors, walls and surfaces of facilities occupied or traversed by animals. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with a solution of 2 oz of KennelSol per gallon of water (or equivalent dilution) (8 ounces per gallon against Canine parvovirus or Porcine parvovirus), using a cloth, mop, sponge, spray, or soaking for a period of 10 minutes. Ventilate buildings and other closed spaces. Do not house animals or employ equipment until treatment has been absorbed, set or dried.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,459,35),(3142,NULL,'{{Product Name}} is effective against Canine Parvovirus (and Porcine parvovirus) at 8 oz. per gallon. Follow {{Area Of Use}} Disinfection Directions.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,460,36),(3143,NULL,'Remove all poultry and feeds from premises, trucks, coops, and crates. Remove all litter and droppings from floors, walls, and surfaces of facilities occupied or traversed by poultry. Empty all troughs, racks, and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Saturate surfaces with the disinfecting solution (2 oz per gallon of water) (660 ppm active quat) (equivalent use dilution) for a period of 10 minutes. Immerse all halters, ropes and other types of equipment used in handling and restraining animals as well as forks, shovels, and scrapers used in removing litter and manure. Ventilate buildings, coops, and other closed spaces. Do not house poultry or employ equipment until treatment has been absorbed, set, or dried. Thoroughly scrub treated f