INSERT INTO `spld_generalstatement` VALUES (157,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,NULL,NULL,NULL,79,49),(158,NULL,'If on skin or clothing\r\n   - Take off contaminated clothing.\r\n   - Rinse skin immediately with plenty of water for 15-20 minutes.',NULL,NULL,NULL,NULL,1,80,50),(159,NULL,'If swallowed\r\n   - Call a poison control center or doctor immediately for treatment advice.\r\n   - Have person sip a glass of water if able to swallow.\r\n   - Do not induce vomiting unless told to do so by the poison control center or doctor.\r\n   - Do not give anything by mouth to an unconscious person.',NULL,NULL,NULL,NULL,2,80,51),(160,NULL,'If inhaled\r\n   - Move person to fresh air.\r\n   - If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible.',NULL,NULL,NULL,NULL,3,80,52),(161,NULL,'If in eyes\r\n   - Hold eye open and rinse slowly and gently with water for 15-20 minutes.\r\n   - Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye.',NULL,NULL,NULL,NULL,4,80,53),(162,NULL,'Do not discharge effluent containing this product into lakes, streams, ponds, estuaries, oceans, or other waters unless in accordance with the requirements of a National Pollutant Discharge Elimination System (NPDES) permit and the permitting authority has been notified in writing prior to discharge. Do not discharge effluent containing this product to sewer systems without previously notifying the local sewage treatment plant authority. For guidance contact your State Water Board or Regional Office of the EPA.',NULL,NULL,NULL,NULL,NULL,81,54),(199,NULL,'IF ON SKIN OR CLOTHING: Take off contaminated clothing. Rinse skin immediately with plenty of water for 15  20 minutes. Call a poison control center or doctor for treatment advice.',NULL,NULL,NULL,NULL,1,100,91),(200,NULL,'IF IN EYES: Hold eye open and rinse slowly and gently with water for 15  20 minutes.  Remove contact lenses, if present, after the first 5 minutes, then continue rinsing eye. Call a poison control center or doctor for treatment advice.',NULL,NULL,NULL,NULL,2,100,92),(201,NULL,'If swallowed: Call a poison control center or doctor immediately for treatment advice. Have person sip a glass of water if able to swallow.  Do not induce vomiting unless told to do so by the poison control center or doctor. Do not give anything by mouth to an unconscious person.',NULL,NULL,NULL,NULL,3,100,93),(202,NULL,'IF INHALED: Move person to fresh air. If person is not breathing, call 911 or an ambulance, then give artificial respiration, preferably by mouth-to-mouth, if possible. Call a poison control center or doctor for treatment advice.',NULL,NULL,NULL,NULL,4,100,94),(203,NULL,'NOTE TO PHYSICIAN: Probable mucosal damage may contraindicate the use of gastric lavage.',NULL,NULL,NULL,NULL,5,100,95),(204,NULL,'Have the product container or label with you when calling a poison control center or doctor or going for treatment.',NULL,NULL,NULL,NULL,6,100,96),(205,NULL,'DANGER. CORROSIVE. Causes irreversible eye damage and skin burns. Harmful if swallowed. Do not get in eyes, on skin, or on clothing. Wear protective eyewear (goggles, face shield or safety glasses), protective clothing and protective gloves (rubber or chemical resistant). Harmful if inhaled. Wash thoroughly with soap and water after handling. Remove contaminated clothing and wash clothing before reuse.',NULL,NULL,NULL,NULL,NULL,101,97),(206,NULL,'PHYSICAL OR CHEMICAL HAZARDS\r\nDo not mix with oxidizers, anionic soaps and detergents.\r\nDo not use or store near