INSERT INTO `spld_marketingstatement` VALUES (2930,NULL,'Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)\r\n\r\nA multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO3) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test.  Disinfects, cleans, and deodorizes in one labor-saving step.\r\n\r\nRecommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households.  Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.\r\n\r\nDisinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical) stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).\r\n\r\nUse [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.\r\nUse [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shields, hearing protectors, and ear muffs.  Rinse all equipment that comes in prolonged contact with skin with warm water and allow to air dry before reuse.  [Caution: Cleaning at the recommended 120ºF. temperature will avoid overheating and distortion of the personal safety equipment that would necessitate replacement.]',NULL,NULL,NULL,NULL,NULL,143,2902),(3291,NULL,'Germicidal Detergent and Deordorant',NULL,NULL,NULL,NULL,NULL,135,3263),(3292,NULL,'For use in: {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous\r\ninanimate surfaces: {{Surface}}, etc.).',NULL,NULL,NULL,NULL,NULL,136,3264),(3293,NULL,'For use in {{Area Of Use}}.',NULL,NULL,NULL,NULL,NULL,137,3265),(3294,NULL,'A multi-purpose germicidal detergent and deodorant effective in hard waters up to 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum. Disinfects, cleans, and deodorizes in one labor saving step.',NULL,NULL,NULL,NULL,NULL,138,3266),(3295,NULL,'Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,NULL,NULL,NULL,NULL,139,3267),(3296,NULL,'Bactericidal against the following pathogenic bacteria according to the AOAC Use-Dilution Test method, current edition, modified in the presence of 400 ppm synthetic hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum:',NULL,NULL,NULL,NULL,NULL,140,3268),(3297,NULL,'Fungicidal against {{Claims}} albicans according to the AOAC fungicidal test, modified in the presense of 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum.',NULL,NULL,NULL,NULL,NULL,141,3269),(3298,NULL,'Virucidal against {{Claims}} according to the virucidal qualification, modified in the presence of 400 ppm hard water (calculated as CaCO3) plus 5 % organic serum.',NULL,NULL,NULL,NULL,NULL,142,3270),(3315,NULL,'Recommended for use in {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: {{Surface}}. Recommended for use in: Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,NULL,NULL,NULL,NULL,124,3287),(3316,NULL,'For use on Highchairs, Sealed terra cotta, Tanning Equipment, Plastic (such as polystyrene or polypropylene), Upholstery, Floors, Refrigerators, Conductive flooring, Refrigerated storage and display equipment, Glazed enameled surfaces, Garbage cans, Bathtubs (Fiberglass), Counters (countertops), Doorknobs, Stainless steel, Coils and drain pans of air conditioning and refri, Microwave ovens, Laminated surfaces, Tanning Beds, Other hard nonporous surfaces made of:, Sealed granite, Telephones, Desks, Outdoor furniture, Woodwork, Cabinets, Chairs, Sealed terrazzo, Bathroom fixtures, Countertop laminates, Metal, Appliances, Sealed limestone, Kennel runs, Sealed slate, Glazed ceramic and Cages.',NULL,NULL,NULL,NULL,NULL,125,3288),(3317,NULL,'Germicidal Detergent and Deordorant',NULL,NULL,NULL,NULL,NULL,126,3289),(3350,NULL,'Recommended for use in {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: {{Surface}}. Recommended for use in: Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,NULL,NULL,NULL,NULL,181,3323),(3351,NULL,'For use on Highchairs, Sealed terra cotta, Tanning Equipment, Plastic (such as polystyrene or polypropylene), Upholstery, Floors, Refrigerators, Conductive flooring, Refrigerated storage and display equipment, Glazed enameled surfaces, Garbage cans, Bathtubs (Fiberglass), Counters (countertops), Doorknobs, Stainless steel, Coils and drain pans of air conditioning and refri, Microwave ovens, Laminated surf