INSERT INTO `spld_storagedisposalstatement` VALUES (131,NULL,NULL,'Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,53,41),(132,NULL,NULL,'Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,NULL,NULL,1,54,42),(133,NULL,'Pesticide Storage','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,NULL,NULL,2,54,43),(134,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,NULL,NULL,3,54,44),(135,NULL,'Container Disposal','(Plastic containers:) Triple rinse (or equivalent). Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn. If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles. Empty residue into application equipment. Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities. If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent). Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities. If burned, stay out of smoke.\r\n',NULL,'NA',NULL,NULL,NULL,NULL,4,54,45),(166,NULL,NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,1,61,76),(167,NULL,'PESTICIDE STORAGE:','Open dumping is prohibited.  Store only in original container. Do not reuse empty container. Keep this product under locked storage sufficient to make it inaccessible to children or persons unfamiliar with its proper use.',NULL,'NA',NULL,NULL,NULL,NULL,2,61,77),(168,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous.  Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law.  If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,NULL,NULL,NULL,3,61,78),(169,NULL,'Container Disposal','(Plastic containers:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn.  If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles.  Empty residue into application equipment.  Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities.  If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent).  Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities.  If burned, stay out of smoke.',NULL,'NA',NULL,NULL,NULL,NULL,4,61,79),(170,NULL,'STORAGE AND DISPOSAL','Store in original container in areas inaccessible to children. Do not reuse empty container.  Wrap and discard in trash (or recycle).',NULL,'NA',NULL,NULL,NULL,NULL,NULL,62,80),(171,NULL,'DISPOSAL:','Do not reuse container.  Wrap and put in trash collection.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,63,81),(297,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,'NA',NULL,NULL,NULL,NULL,1,89,71),(298,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,'NA',NULL,NULL,NULL,NULL,2,89,72),(299,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,'NA',NULL,NULL,NULL,NULL,3,89,73),(300,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,'NA',NULL,'M','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide ','or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',4,89,74),(301,NULL,'Containe